- REDUÇÃO NA CONTA DE ENERGIA PODE CHEGAR A 19%.

. Após aprovação e sanção da Lei do teto de 18% para as alíquotas de ICMS na energia;

.A capitalização da Eletrobras, que destinou R$ 5 bilhões para modicidade tarifária em 2022;

.A devolução integral aos consumidores de créditos tributários;

. Mesmo que todos os senadores do PT tenham votado contra a proposta de redução de ICMS, o ex-presidiário lula (PT) tenha se manifestado contrário à diminuição de tributos para o povo e os governadores, a maioria do Nordeste, tenham acionado o STF para impedir a diminuição dos mesmos, depois da redução do preço dos combustíveis, o Brasil perceberá a mudança também na conta de luz.

